import React, { useState } from 'react';
import './Login.css';

const Login = ({ onLogin }) => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    onLogin(email, password);
  };

  return (
    <div className="login-container">
      <h1 className="project-title">Attenue</h1>
      <div className="bubble-background">
        <div className="bubble" style={{ '--i': 1 }}></div>
        <div className="bubble" style={{ '--i': 3 }}></div>
        <div className="bubble" style={{ '--i': 5 }}></div>
        <div className="bubble" style={{ '--i': 7 }}></div>
        <div className="bubble" style={{ '--i': 9 }}></div>
        <div className="bubble" style={{ '--i': 11 }}></div>
        <div className="bubble" style={{ '--i': 13 }}></div>
        <div className="bubble" style={{ '--i': 15 }}></div>
        <div className="bubble" style={{ '--i': 17 }}></div>
        <div className="bubble" style={{ '--i': 19 }}></div>
        {/* Additional bubbles to enhance the scattered look */}
        <div className="bubble" style={{ '--i': 21 }}></div>
        <div className="bubble" style={{ '--i': 23 }}></div>
      </div>
      <form className="login-form" onSubmit={handleSubmit}>
        <h2>Teacher Login</h2>
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <button type="submit">Login</button>
      </form>
    </div>
  );
};

export default Login;
